import './App.scss';
import Login from './component/Login/Login';
import Nav from './component/Navigation/Nav';
import React from "react";
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import Register from './component/Register/Register';
import Users from './component/ManageUsers/Users';

function App() {
  return (
    <Router>
      <div className='app-container'>
        <Nav/>
        <Switch>
          <Route path="/new">
            new
          </Route>
          <Route path="/about">
            about
          </Route>
          <Route path="/contact">
            contact
          </Route>
          <Route path="/login">
            <Login />
          </Route>
          <Route path="/register">
            <Register />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/" exact>
            HOme
          </Route>
          <Route path='*'>
            Not Found
          </Route>
        </Switch>
      </div>

      <ToastContainer
        position="top-right"
        autoClose={5000}
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
        theme="light"
      />
    
    
    </Router>
  )
}

export default App;
